import { faHome, faEdit } from '@fortawesome/free-solid-svg-icons';
export interface NavigationItem {
    id: string;
    title: string;
    icon?: string;
    url?: string;
    active?: boolean;
  }

  faHome = faHome;
  faEdit = faEdit;

  export const NavigationItems: NavigationItem[] = [
    {
        id: 'nav-home',
        title: 'Home',
        url: '/home',
        icon: 'faHome'
    },
    {
        id: 'nav-cadastro',
        title: 'Cadastro',
        url: '/cadastro',
        icon: 'faEdit'
    },
    {
        id: 'nav-acoes',
        title: 'Ações',
        url: '/acoes',
        icon: 'faEdit'
    },
    {
        id: 'nav-controladora',
        title: 'Controladora',
