        icon: 'faHome'
    },
    {
        id: 'nav-visita',
        title: 'Visita',
        url: '/visita',
        icon: 'faHome'
    },
    {
        id: 'nav-relatorios',
        title: 'Relatórios',
        active: false,
        url: '/relatorios',
        icon: 'faHome'
    }
    ];
